example, in Australia, if you spend $16,000 on a solar set up, they will rebate you up to $8000 back. This doesn't include other rebates you can get either. You'll need to check your own country's government policies - but, in the next 5-10 years - all countries will be jumping on the solar bandwagon.<\/p><h3>Not Just A 'One Time' Set Up + Easy Installation<\/h3><p>With solar, you don't need to invest into a bunch of costly arraysrightaway. You're able to set up one panel at a time, and add additional panels whenever you feel the time is right. Furthermore,installing a solar panel is actually quite a lot easier than peoplethink. You can do it yourself, or have an installer come and have itset up for you the same day.<\/p><\/div>",_X='<gwt:clipper style="',yU='<html><body onload="if(parent.__gwt_onHistoryLoad)parent.__gwt_onHistoryLoad(__gwt_historyToken.innerText)"><div id="__gwt_historyToken">',gY="<img onload='this.__gwtLastUnhandledEvent=\"load\";' src='",FS='=',YS='>',DX='?',zQ='@',_W='A PotentialElement cannot be resolved twice.',$R='A request timeout has expired after ',EQ='ABQIAAAAG8LzhtshQCjpSshU_uJjmxTBfUk9TZrBRaIteybtnU2KziHEpRQvhPNTjo7DMczjrRD3yBPRJ_BSQQ',DQ='ABQIAAAAG8LzhtshQCjpSshU_uJjmxTwM0brOpm-All5BF6PoaKBxRWWERTZER2lJ4GnsG8nvhKLOQ20degaEQ',D$='AGL',AY='AREA',C3='AbsolutePanel',j2='AbstractCollection',Z4='AbstractDataTable$ColumnType',_4='AbstractDataTable$ColumnType;',M5='AbstractHashMap',N5='AbstractHashMap$EntrySet',O5='AbstractHashMap$EntrySetIterator',Q5='AbstractHashMap$MapEntryNull',R5='AbstractHashMap$MapEntryString',o4='AbstractList',S5='AbstractList$IteratorImpl',T5='AbstractList$ListIteratorImpl',g2='AbstractMap',U5='AbstractMap$1',V5='AbstractMap$1$1',P5='AbstractMapEntry',B2='AbstractRenderer',_2='AbstractSerializationStream',a3='AbstractSerializationStreamReader',b3='AbstractSerializationStreamWriter',k2='AbstractSet',nT='ActiveXObject',KS='Add not supported on this collection',UY='Add not supported on this list',n0='AjaxKeyConstants_',
